import React, { useState, useEffect } from 'react';
import './../../../Utils/Dashboard/style.css';
import './../../../Utils/Dashboard/css/header.css';
import './../../../Utils/Dashboard/css/bootstrap.min.css';
import Logo from './../../../images/logo.png'
import Profiles from './../../../images/christian-buehner-DItYlc26zVI-unsplash 1.png'
import calendar from './../../../images/calendar.png'
import goal from '../../../images/goal.png';
import planning from './../../../images/planning.png';
import subscription from "./../../../images/subscription.png"
import invitation from './../../../images/invitation.png'
import payment_method1 from './../../../images/payment-method1.png'
import shout from './../../../images/shout.png'
import vector from './../../../images/vector.png'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";



function HeaderComponents(props) {
    const [user, setUser] = useState({})


    useEffect(() => {

        const user = JSON.parse(localStorage.getItem('user'));
        setUser(user)

    }, []);


    return (
        <header id="home-menu" class="admin-menu">
            {
                console.log("props---->", props)
            }
            <div class="container" id="navv">
                <div class="row">
                    <div class="col-lg-3 col-md-10 col-10" id="bannar-logo">
                        <a href="index.html">
                            <img src={Logo} class="img-fluid" />
                        </a>
                    </div>


                    <div class="col-2 col-md-2 text-right show--mobile--only">
                        <ul>
                            <li class="mob-only-menu text-right">
                                <a href="#">
                                    <i class="fa fa-bars mob-menu threebar"></i>
                                </a>
                            </li>
                        </ul>
                    </div>

                    <div class="col-lg-9 col-md-12 col-12 mob-manubarr">
                        <ul class="ulone">
                            <li><a href="#">Home</a></li>
                            <li><a href="#">Workout Programs</a></li>
                            <li><a href="#">Subscribe</a></li>
                            <li>
                                <figure style={{ marginLeft: 200 }}>
                                    {user?
                                        <img src={user.profile_image} class="img-fluid" alt="" />
                                        :
                                        <img src={Profiles} class="img-fluid" alt="" />
                                    }
                                </figure>
                            </li>
                            <li id="sign-btn">
                                <select>
                                    <option>Hi, Griffine</option>
                                    <option>Log out</option>
                                    {/* <option>Hi, friffine</option>
                                <option>Hi, briffine</option> */}
                                </select>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        </header>
    );
}

export default HeaderComponents;
